import React from 'react';
import './styles/SpeciesInsurance.css'
import Title from './UI/Title/Title';

const SpeciesInsurance = () => {
    return (
        <div className='SpeciesInsurance'>
            <Title hType='h1' style={{textAlign: 'left'}}>Виды<br/> страхования</Title>     
            <div className="ImagesTargetBlocks">

                <div className="ImagesTargetBlocks__block">
                    <div className="ImagesTargetBlocks__block__text"></div>
                    <div className="ImagesTargetBlocks__block__icon-block">

                    </div>
                </div>

                <div className="ImagesTargetBlocks__block_revers">
                    <div className="ImagesTargetBlocks__block__text"></div>
                </div>

            </div>
        </div>
    );
};

export default SpeciesInsurance;
